	int i, j, s=1010, h=430, REP, g=210; // LAS VARIABLES PARA MOVER EL DIBUJO DE AGUITA ES H Y G, Y PARA FUEGUIT S Y H
	
	int XM , YM , TAM=1, COL , FIL , contX , contY; // TAM ES EL MULTILICADOR
	int DA=25, DF=90;

	for(REP=0; REP<5; REP++) // LOS DIBUJOS DE AGUA SE VAN A DIBUJAR 5 VECES, Y POR CADA CICLO QUE PASE AUMENTAN SU TAMANIO
	{
		COL= 42*TAM;
		FIL= 26*TAM;
		for(XM=0,contX=0; XM<COL; XM+=TAM, contX++) { 
			for(YM=0,contY=0; YM<FIL; YM+=TAM, contY++) {
				for(i=0; i<TAM; i++)
				{ 
					for(j=0; j<TAM; j++)
					{
						if(aguita[contY][contX]!=0){
							putpixel(g+i+XM, h+j+YM, aguita[contY][contX]);
						}
						if(fueguito[contY][contX]!=0){
							if(REP==4){
								continue; // EL DIBUJIO DE FUEGO ES MAS GRANDE ASI QUE SOLO SE IMPRIMIRA 4 VECES PARA COMPENSAR ENTONCES EL TAMANIO DEL DISPARO DE AGUA
							}
							putpixel(s+i+XM, h+j+YM, fueguito[contY][contX]);	
						}
					}
				}
			}
		}
		
		delay(200);
		
		DA+=15, DF+=15; // DA ES PARA AUMENTAR EL VALOR DE SEPARACION ENTRE IMAGEN DEL DISPARO DEL AGUA, LO MISMO SERIA PARA LA OTRA VARIABLE DF
		s-=DF, g+=DA, h-=5, TAM++;
	}
	
	
